INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('03LRBK', ' Democratizing Scrutiny as Aphoristically Constructed Mediators.', 'Linguistics & Language', '0736', 92.4347, NULL, 9, 1347, ' It is debatable that this will be recommended as the most educative publication on the subject, balancing as it does the resonance between memories and epistemology. with a nod to both Process Philosophy and Nihilism, it describes scrutiny as a site of plasticity.', '2000-05-10 20:55:02.930');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('04NAXO', ' Literary Justice as Divided Mediators.', 'Travel', '0877', 53.5603, 14848.4978, 6, 380, ' This enlightening book evokes various gendered Ambivalences and their relation to Deontological Ethics: and the influence of the performing intertextuality depicts the gender perception representing heterotopian claims to progress.', '2004-01-06 02:08:06.780');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('05B4X1', ' Debating Play and the Gendering of Space in the Gilded Age.', 'Economics', '1389', 48.3680, 2837.7122, 8, 1975, ' The author educes neoliberalism and its relationship to the body in personal letters by JG Ballard, and traces nuanced, profound ruminations on topics from the mundane to the profound.', '2001-02-20 07:52:44.270');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('05XKTJ', ' Debating Play and the Gendering of Space in the Gilded Age.', 'Game Studies', '0877', 80.6118, 6898.0230, 19, 97, ' following influences from experience, power and masochism, the dissertation narrates gendered Labor Migration through time', '2005-06-30 05:42:59.560');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('06KF2P', ' Debating Regeneration as Divided Mediators.', 'Business', '1389', NULL, 12434.4174, 16, 590, ' uncovering influences from synesthesia, archetype and experience, the book observes visualisation through time', '2005-02-14 18:06:35.630');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('06XCF3', ' De-Centering the Body as a Means of Sustainable and Dystopic Telesthesia.', 'Digital Humanities & New Media', '0877', 28.8722, 4870.4282, NULL, 958, ' the resonance between spectatorship and its intersections with subculture in this republished series of lectures is a penetrating statement.  With influences as diverse as as Surrealism and Post-modermnism, new harmonies which dominate the early chapters traces gifts as unwanted justice.', '2005-12-31 08:45:37.740');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('074QW3', ' Historicizing Masochism Through a Theoretical Lens.', 'Technology and Transport', '1389', 95.2670, 13298.5122, 13, 329, ' the relationship between Ambivalence and its relationship to scrutiny in this nostalgic compilation is a source of gripping insights.  Drawing from sources such as Shuddhadvaita, the humanities and Deconstructionism as inspiration, new harmonies which dominate the early chapters narrates utopic self-invention in new emotional media.', '2006-04-06 11:43:06.260');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('07S0WD', ' the Epicentre of Possibilities as Fragments of Inequality.', 'Social Sciences', '0736', 95.7125, 2365.7922, 15, 949, ' This book relates the relationship between synesthesia and telesthesia. It draws inspiration from influences as diverse as the Oxford Franciscan school and Empiricism, and by describing the inequality and neoliberalism, new tensions are uncovered through a lens of spatial justice', '2007-07-31 05:18:52.890');
INSERT INTO titles (title_id, title, type, pub_id, price, advance, royalty, ytd_sales, notes, pubdate) VALUES ('080R19', ' Gender and Oppression as a Site of Theoretical Contestation.', 'Biography', '1389', 53.0417, 7393.6922, 16, 49, ' destabilizing socially-responsible utopic self-invention is penetrating, discoursive and effective. This dissertation traces the aphoristically constructed and unwanted imperatives of political dissent.', '2005-12-31 02:01:32.490');
